import React from "react";
import { useParams } from "react-router-dom";
const PageForm = () => {
  const { id } = useParams();

  return (
    <div>
      <h1>Olaaaaa form {id && <div>id: {id}</div>} </h1>
    </div>
  );
};

export default PageForm;
